    "abbr" : "1.1.3.1",
    "name" : "हवा ",
    "description" : "हवा। कुछ शब्द हवा के आरंभ और अंत के लिए प्रयोग किए गये हैं। हवा की गति मे अंतर आता है, इसलिए कुछ शब्द इस बात को दर्शाते हैं कि हवा किस गति से बह रही है। इन्हें बहुत धीमे से बहुत तेज के एक पैमाने पर रखने की कोशिश कीजिए। इन शब्दों को इस आधार पर भी विभाजित किया जा सकता है, कि हवा क्या करती है, क्योंकि तेज हवा ज्यादा कार्य करती है। इन शब्दों को इस आधार पर भी विभाजित किया जा सकता है, कि हवा कितनी देर तक बहती है। कुछ शब्द का प्रयोग हवा की गति धीमे या तेज होने के लिए किया गया है। कुछ शब्दों का प्रयोग, एक समान बहने वाली हवा और अपनी गति निरंतर बदलने वाली हवा के अंतर के लिए किया गया है। कुछ शब्दों का प्रयोग हवा की गति थोडी देर के लिए ज्यादा होने के लिए की गई है। सधी हुई हवा किसी एक दिशा में बढ़ती है, इसलिए हवा की दिशा के लिए प्रयुक्त शब्दों को शामिल किया गया है। हवा की दिशा दिशासूचक यंत्र के बिंदु, या किसी पडोस की भौगोलिक विशेषता या क्षेत्र या वक्ता किस दिशा मे बढ़ रहा है इसकी ओर इंगित कर सकती है।  कुछ शब्द ऐसी हवा के लिए प्रयुक्त किए गए हैं, जो एक छोटे वर्णाकार में घूमती है, जिससे धूल का एक स्तंभ या कीप नुमा बादल निर्मित होता है। कुछ शब्द, हवा क्या करती है, इसके लिए प्रयुक्त किए गए हैं, जैसे कि जब वह बहती है या किसी को हानि पहुँचाती है। लोग हवा को महसूस कर सकते हैं, इसलिए कुछ शब्द उसके आभास के लिए प्रयुक्त किए गए हैं। हवा आवाज निकालती है, इसलिए ऐसे शब्द हैं जो हवा की ध्वनि के लिए प्रयुक्त किए गए हैं। कुछ संस्कृतियों मे हवा और आत्माओं के बीच में संबंध हैं, इसलिए कुछ शब्द, हवा मे आत्माओं की गतिविधियों या, हवा के द्वारा बीमारी होती है, इसके लिए प्रयुक्त किए गए हैं।",
