  "1.6.1" : {
    "guid" : "73499b8b-76fc-4121-8bfa-1bdebe537259",
    "key" : "1.6.1",
    "abbr" : "1.6.1",
    "name" : "जानवरों के प्रकार",
    "description" : "जानवरों के विभिन्‍न प्रकार।  जानवरों की प्रजातियाँ और उनके वैज्ञानिक नाम जानने के लिए चित्रों की एक पुस्तक का उपयोग करें। इस खंड को वैज्ञानिक एवं जीवविज्ञान द्वारा जानवरों के विभाजन के अनुसार संगठित किया गया है। को विभिन्‍न विषयों में विभाजित करती हैं, और उनके बीच तुलना करना हमेशा संभव नहीं होता। विभाजन का आधार उनकी विशेषताएं हो सकती हैं (पेड़ों और झाड़ियों को उनके आकार तथा डालियों की संख्या के आधार पर बांटा जाता है), और उनके उपयोग हो सकते हैं  हो सकता है कि यह जानवरों को स्थानीय वर्गीकरण (लोक वर्गीकरण) से मेल नहीं खाता हो), जो प्राय: इस पर आधारित होता है कि लोग किस तरह से जानवरों का उपयोग करते हैं (पालतु/जंगली, खाद्य/श्रम)। यह जानवरों के ऐसे बडे वर्ग से संबंध रखता है जो वैज्ञानिक वर्गीकरण से मेल नहीं खाता है। उदाहरण के लिए उड़ने वाले जानवर जिनमे पक्षी, चमगादड़ और उड़ने वाले कीट शामिल हैं।",
    "value" : "1.6.1 जानवरों के प्रकार"
  },
