    "name" : "जानवरों की चाल",
    "description" : "जानवरों के चलने के तरीके। सिर्फ जानवरों की चाल के लिए प्रयुक्त विशेष शब्दों को ही सम्मिलित करें। लोगों की चाल के लिए चलन विषय का उपयोग करें। प्रत्येक जानवर किस तरह से चलता है, यह सोचना ज़रूरी है, विशेषकर जो महत्वपूर्ण हैं।",
