    "name" : "नर और मादा जानवर",
    "description" : "नर और मादा जानवरों से संबंधित। प्राय: सभी भाषाओं में नर और मादा के लिए विशेष शब्द सिर्फ़ पालतु जानवरों के लिए ही होती हैं। कुछ में सिर्फ़ नर के लिए शब्द होंगे या इसके विपरीत। कुछ में एक के लिए प्रयुक्त शब्द को दोनों के लिए प्रयोग में लाया जाता है।   [: नर, मादा]",
