    "description" : "इस कार्यक्रम के शब्‍दों का प्रयोग विचार जैसे कि (कहा, लिखा, सोचा या बनाया गया) को व्‍यक्‍त करने के लिये करे या जो एक विषय से सं‍बंधित हो, या कुछ तार्किक विषय से संबंधित हो,  के लिये करे। इस कार्यक्रम का प्रयोग उन शब्‍दों के लिये भी किया जा सकता है जो कि किसी बात या विषय को रेखांकित करते हो, जैसे कि किसी के बारे मे सोचना, किसी के बारे में बात करना या लिखना। सोचने, जानने, बोलने क्रियाऐ (दूसरी अभिव्‍यक्‍तियाँ) यहा विषय का रुप ले सकती है। हम किसी विषय को मुख्‍य विचार कह सकते है। इस कार्यक्रम का प्रयोग किसी चित्र की महत्‍वपूर्ण वस्‍तुओं के लिये भी किया जा सकता है।  संबंधित कार्यक्रम : किसी विषय के बारे में करना",
