    "name" : "निंदा करना",
    "description" : "इस कार्यक्रम का प्रयोग उन शब्‍दों के लिए करें जो किसी व्‍यक्‍ति या वस्‍तु की निंदा करने या उसकी बुराई करने से संबंधित हो -- किसी चीज को बुरा कहना, विशेषकर वह कार्य जो किसी ने किया हो।",
