    "name" : "पत्ता खेल",
    "description" : "इस क्षेत्र का प्रयोग किसी विशेष खेल से संबंधित शब्‍दो के लिए करे। उदाहरण मे दिए गए शब्‍द ताश के खेल से है। यदि आप अपने संस्‍कृति मे ताश का खेल नहीं खेलते है, आप अपने एक खेल का नाम इस क्षेत्र मे प्रयोग कर सकते हैं। अपने हर एक खेल के लिए दूसरा क्षेत्र जोड़ सकते हैं।",
