    "name" : "बना हुआ भोजन",
    "description" : "बने हुए भोजन को संबोधित करने वाले शब्दों के लिए इस क्षेत्र का उपयोग करें। संस्कृतियाँ बहुत भिन्‍न हैं, जिस तरह के और कितने प्रकार के भोजन वे पकाते हैं, और वे किस प्रकार उनको वर्गीकृत करते हैं। उदाहरण के लिए, जिस तरह अँग्रेज़ मुख्य भोजन और उससे हटकर रखे हुए भोजन के बीच भिन्‍नता करते हैं, यह वर्गीकरण दूसरी भाषाओं में नहीं पाया जाता है। अगर आपकी भाषा में अच्छे से मान्यता प्राप्त उपवर्ग हैं, तो आप प्रत्येक के लिए अलग उपक्षेत्र बना सकते हैं। भोजन के मुख्य सामग्री पर आधारित नीचे कुछ प्रश्न पूछे गए हैं।",
