    "name" : "विशेष लोगों के लिए वस्त्र",
    "description" : "विशेष लोगों के द्वारा पहने गए विशेष वस्त्रों के लिए इस क्षेत्र का उपयोग करें। यह ज़रूरी है कि संस्कृति में विभिन्‍न प्रकार के विशेष लोगों के बारे में सोचें और उनके द्वारा पहने गए कोई भी विशेष वस्त्रों के बारे में सोचें। कुछ उदाहरण नीचे दिए गए हैं, परंतु बहुत से और भी हैं। ",
