  "7.2" : {
    "guid" : "c7c85346-158d-4881-839d-9a6a8e47209b",
    "key" : "7.2",
    "abbr" : "7.2",
    "name" : "हिलाना",
    "description" : "Use this domain for intransitive verbs of movement referring to moving your whole body to a different location. There are many components of meaning involved in verbs of movement. They can include a source location (from), a goal location (to), a path (along), manner (walk, run), speed (race, crawl), direction\n\t\t\t\t\t\t\t\t\t(forward, back, side, up, down, toward, away from), shape of the path (straight, curve, circle, angle), relationship to some object or objects (on, hang, against, between, across, through, into, out of, onto, off of, around), proximity (near, far), multiple movements (back and forth, return, bounce), inclusion with other objects or parts of objects (join, leave, collect, disperse, unite, separate), volition (go versus drift), intransitive versus transitive (move versus move something). Some verbs of movement do not involve moving from one place to another, but express bodily movement.",
    "value" : "7.2 हिलाना"
  },
