    "key" : "8.1.1",
    "abbr" : "8.1.1",
    "name" : "संख्या",
    "description" : "इस कार्यक्षेत्र का उपयोग संख्याओं से सम्बन्धित शब्दों के लिए करें। प्रत्येक भाषा में ‘एक’ के लिए अलग शब्द होता है और ‘दो’ के लिए अलग शब्द। इन दोनों संख्याओं के अक्सर अपने विशेष शब्द होते हैं। इसलिए हमने ‘एक’ और ‘दो’ के लिए अलग कार्यक्षेत्र का उपयोग किया है। इसके अतिरिक्त संख्याएँ एक श्रंखला बनाती हैं (एक, दो, तीन…)। अधिकतर भाषाओं में इन संख्याओं की एक से अधिक श्रंखलाएँ होती हैं (पहला, दूसरा, तीसरा…)। इसलिए अधिकतर भाषाओं में पाई जाने वाली संख्याओं की प्रत्येक श्रंखला के लिए हमने एक कार्यक्षेत्र शामिल किया है। आपकी भाषा में संख्याओं की ये श्रंखलाएँ भिन्न हो सकती हैं। उन्हें ‘संख्या-श्रंखला’ के कार्यक्षेत्र में डाल दीजिए।",
    "value" : "8.1.1 संख्या"
