    "description" : "इस कार्यक्षेत्र का उपयोग उन शब्दों तथा मूल शब्द के साथ कुछ जोड़े जाने पर बनने वाले नए शब्दों के लिए करें, जिनसे यह पता चलता है कि अब यह वस्तु संख्या में एक से अधिक हो गई है। कुछ भाषाओं में, जैसे कि इण्डो-यूरोपियन भाषाओं में बहुवचन बनाने के लिए मूल शब्द के साथ कोई अक्षर जुड़ जाता है। अन्य भाषाओं में, जैसे कि ऑस्ट्रोनीश़न अर्थात दक्षिण-पूर्वी एशिया में बोली जाने वाली भाषाओं में बहुवचन बनाने के लिए मूल शब्द के साथ एक अतिरिक्त शब्द जोड़ दिया जाता है। कुछ भाषाओं में मूल शब्द के साथ ऐसे कुछ अक्षर या अलग शब्द जुड़ते हैं, जो दर्शाते हैं कि बहुवचन की संख्या दो है या दो से अधिक।",
