    "name" : "हिस्सा",
    "description" : "अनेक वस्तुएँ ऐसी होती हैं जिनके अलग-अलग हिस्से होते हैं। इस कार्यक्षेत्र का उपयोग किसी वस्तु के हिस्सों को दर्शाने वाले शब्दों के लिए करें और उन शब्दों के लिए भी जो दर्शाते हैं कि किसी वस्तु के अलग-अलग हिस्से हैं, कि कोई वस्तु किसी अन्य वस्तु का हिस्सा है, या जो किसी सम्पूर्ण वस्तु को उसके हिस्से के साथ जोड़ते हैं। संबंधित कार्यक्षेत्र: वस्तुओं के हिस्से, से बना हुआ, सामग्री",
    "value" : "8.1.6.1 हिस्सा"
