    "description" : "इस कार्यक्षेत्र का उपयोग उन शब्दों के लिए करें, जो दर्शाते हैं कि कोई वस्तु, जैसे कि कोई उपकरण या काम करने का तरीका, किसी विशिष्ट समय, स्थान, उद्देश्य या कार्य के लिए अनुचित है।",
