    "description" : "इस कार्यक्षेत्र का उपयोग दाग़ से संबंधित शब्दों के लिए करें—ऐसे किसी भी छोटे तथा गंदे धब्बे के लिए, जो किसी मनुष्य की चमड़ी पर या किसी वस्तु की सतह पर पड़ जाता है, किंतु यह गंभीर नहीं होता, विशेषकर ऐसी खराबी नहीं होती कि किसी का कामकाज रुक जाए।",
