    "description" : "इस कार्यक्षेत्र का उपयोग उन सामान्य विशेषणों के लिए करें, जो किसी विशिष्ट विशेषण के स्थान पर उपयोग किए जा सकते हैं या इसका स्थान ले सकते हैं।",
