  "9.2" : {
    "guid" : "af0909a5-928a-4421-baaa-f33b14302714",
    "key" : "9.2",
    "abbr" : "9.2",
    "name" : "शब्द-भेद",
    "description" : "यह कार्यक्षेत्र संरचना के उद्देश्य के लिए है और इसे किन्हीं शब्दों के लिए उपयोग नहीं किया जाना चाहिए। इस अनुभाग में दिए गए कार्यक्षेत्रों का उपयोग उन शब्दों के लिए करें, जिनका संबंध किसी विशिष्ट शब्द-भेद से है। अच्छा यह है कि इन कार्यक्षेत्रों का उपयोग न ही किया जाए, क्योंकि यह व्याकरण पर आधारित हैं न कि अर्थ पर। परंतु यदि शब्दों का कोई ऐसा छोटा समूह है जिसका संबंध शब्द-भेद से है और आप उन सभी शब्दों के विषय में बताना चाहते हैं, तो आप इन कार्यक्षेत्रों का उपयोग कर सकते हैं। इस अनुभाग में आप उन शब्दों को भी श्रेणीबद्ध कर सकते हैं, जिनके अर्थ आपको पता नहीं हैं।",
    "value" : "9.2 शब्द-भेद"
  },
  "9.2.1" : {
    "guid" : "64f39297-426b-45a8-b5d2-097cf71d688c",
    "key" : "9.2.1",
    "abbr" : "9.2.1",
    "name" : "विशेषण",
    "description" : "इस कार्यक्षेत्र का उपयोग सभी विशेषणों को सूचीबद्ध करने के लिए करें। यदि आपकी भाषा में बहुत सारे विशेषण हैं, तो आप उन सभी को यहाँ सूचीबद्ध करने का प्रयत्न न करें। यदि आप सभी विशेषण देखना चाहते हैं, तो अधिकतर शब्दकोश प्रोग्राम शब्द-भेद के द्वारा आपके शब्दकोश को वर्गीकृत कर सकते हैं। परंतु यदि आपकी भाषा में बहुत थोड़े विशेषण हैं, तो आप उन सभी को यहाँ इस कार्यक्षेत्र में डाल सकते हैं। “सभी विशेषण कहाँ चले गए?” पुस्तक में, आर ऐम.डबल्यु. डिक्सन (डिक्सन, आर.ऐम.डबल्यु. 1982। सभी विशेषण कहाँ चले गए? बर्लिन: माउटोन।) शब्दार्थ के सात विश्वव्यापी प्रकार बताते हैं, जो आमतौर पर विशेषण के द्वारा व्यक्त किए जाते हैं। वे हैं: आयु (नव, जवान, बुजुर्ग), परिमाप (बड़ा, संक्षिप्त, लंबा, छोटा, चौड़ा, संकीर्ण, गाढ़ा, मोटा, पतला), मूल्य (अच्छा, बुरा, उचित, सही, उत्कृष्ट, ठीक, स्वादिष्ट, नृशंस, गरीब), रंग (काला, सफेद, लाल), मानव प्रवृत्ति (ईर्ष्या, खुशी, दयालु, चालाक, उदार, क्रूर, कठोर, अभिमानी, दुष्ट) शारीरिक आयाम (कठोर, मुलायम, भारी, हल्का, कड़ा, नरम, गरम, ठण्डा, मीठा, खट्टा), गति (तेज़, धीमा)। मानव प्रवृति श्रेणी के शब्द संज्ञा और शारीरिक आयाम और गति श्रेणी के शब्द क्रिया हो सकते हैं।",
    "value" : "9.2.1 विशेषण"
  },
  "9.2.2" : {
    "guid" : "24d3d7f9-0fda-4759-930b-6b721d3e9115",
    "key" : "9.2.2",
    "abbr" : "9.2.2",
    "name" : "क्रिया-विशेषण",
    "description" : "इस कार्यक्षेत्र का उपयोग सभी क्रिया-विशेषणों को सूचीबद्ध करने के लिए करें। यदि आपकी भाषा में बहुत अधिक क्रिया-विशेषण हैं, तो शायद उन सभी को यहाँ इंगित करने की आवश्यकता नहीं है। शू-बॉक्स प्रोग्राम (और अन्य शब्दकोश प्रोग्राम) शब्द-भेद के द्वारा आपके शब्दकोश को वर्गीकृत कर सकते हैं।",
    "value" : "9.2.2 क्रिया-विशेषण"
  },
  "9.2.3" : {
    "guid" : "0296465a-25de-4af6-a122-376956b4b452",
    "key" : "9.2.3",
    "abbr" : "9.2.3",
    "name" : "सर्वनाम",
    "description" : "इस कार्यक्षेत्र का उपयोग स्वतन्त्र, कर्ता, कर्म और स्वत्वबोधक सर्वनाम सहित व्यक्तिगत सर्वनामों के लिए करें। अच्छा होगा यदि सारे सर्वनामों की एक सारणी बना ली जाए। इस प्रकार से इस बात संभावना अधिक होगी कि आप सभी सर्वनामों को सूचीबद्ध कर पाएँ और जान सकें कि वे एक दूसरे के साथ कैसे संबंधित हैं। अँग्रेज़ी की अपेक्षा अन्य किसी भाषा में इनके वर्ग तथा विभिन्नताएँ अधिक हो सकती हैं या इससे कम भी। उदाहरण के लिए, कई भाषाओं में “हम” सर्वनाम में श्रोता शामिल होता है, जबकि एक और सर्वनाम “हम” में श्रोता शामिल नहीं होता। कुछ भाषाओं में ऐसा अनिश्चित सर्वनाम पाया जाता है, जिसका अर्थ अँग्रेज़ी में “कोई” होता है। अँग्रेज़ी भाषा के विपरीत बहुत सारी भाषाओं में पुलिंग (पुरुष वाचक), स्त्रीलिंग (स्त्री वाचक) और नपुंसक लिंग की संज्ञा (नपुंसक) नहीं होती है। प्रत्येक भाषा में सर्वनामों के समूहों और कार्यों का पता लगाना आवश्यक है।   ",
    "value" : "9.2.3 सर्वनाम"
  },
