    "description" : "इस कार्यक्षेत्र का उपयोग उन सर्वनामों के लिए करें, जो किसी अनिश्चित व्यक्ति या वस्तु के विषय में न बताते हुए किसी भी व्यक्ति या वस्तु को दर्शाते हैं। कुछ भाषाओं में सर्वनामों के निम्नलिखित सभी वर्ग नहीं होंगे। आपकी भाषा में मिलने वाले प्रत्येक वर्ग को सर्वनाम सारणी में जोड़ें। ",
