  "9.5" : {
    "guid" : "aab82dc7-de9f-44b3-845e-0c926f47cfb6",
    "key" : "9.5",
    "abbr" : "9.5",
    "name" : "कारक",
    "description" : "प्रत्येक क्रिया का शब्दार्थ कारक संबंधों का एक वर्ग होता है। उदाहरण के लिए, इस वाक्य ‘मैंने अपनी पत्नी को फूल दिए’ में क्रिया ‘देने’ के तीन कारक संबंध हैं। ‘मैं’ कर्ता है, ‘फूल’ कर्म है और ‘अपनी पत्नी’ प्राप्तकर्ता है। इस वाक्य में कारक संबंध को चिह्नित करने वाला एकमात्र शब्द है ‘को’। अँग्रेज़ी भाषा अक्सर कारक संबंधों को किसी वाक्य में उनकी अवस्थिति के अनुसार चिह्नित करती है। कुछ भाषाएँ कारक संबंधों को प्रत्ययों, पूर्वसर्गों, परसर्गों तथा कभी-कभी विशेष क्रियाओं के द्वारा चिह्नित करती हैं। किसी भाषा के पूर्ण विवरण के लिए अनिवार्य है कि प्रत्येक क्रिया की विवेचना की जाए, इसके सभी कारक संबंधों की पहचान की जाए, तथा जितने भी प्रकार से इन संबंधों को चिह्नित किया गया है, उन सभी का विवरण दिया जाए। क्योंकि ये क्रियाएँ अक्सर अद्वितीय तथा अपने कारक संबंधों में अप्रत्याशित होती हैं, इसलिए यह जानकारी शब्दकोश में संकलित की जानी चाहिए। इस अनुभाग का उपयोग उन शब्दों तथा प्रत्ययों के लिए किया जाना चाहिए, जो कारक संबंधों को चिह्नित करने के लिए प्रयुक्त किए जाते हैं। इस कार्यक्षेत्र का उपयोग कारक को दर्शाने वाले तकनीकी शब्दों के लिए किया जाना चाहिए।",
    "value" : "9.5 कारक"
  },
