    "description" : "इस अनुभाग का उपयोग उन शब्दों के लिए करें, जो किसी वाक्य में शब्दार्थ के भाव से एक समान घटनाओं/कार्यक्रमों को जोड़ते हैं। एक वाक्य अक्सर दो या दो से अधिक परिस्थितियों को प्रस्तुत करता है, जो एक या दो पहलूओं में एक दूसरे से भिन्न हो सकती हैं। इस कार्यक्षेत्र में सम्मिलित किए जाने वाले शब्द संकेत करते हैं कि दो परिस्थितियाँ प्रस्तुत की जा रही है, या ये शब्द दो परिस्थितियों में भिन्नताओं को चिह्नित करते हैं।",
