    "description" : "इस कार्यक्षेत्र का उपयोग उन शब्दों के लिए करें, जो दर्शाते हैं कि कोई बात किसी समूह, नियम, या पद्यति के लिए अपवाद है—कोई बात किसी समूह के सभी लोगों या वस्तुओं के लिए सच है, परंतु किसी एक के लिए नहीं है।",
    "value" : "9.6.1.5.1 अतिरिक्त"
