    "description" : "इस कार्यक्षेत्र का उपयोग उन शब्दों के लिए करें, जो ऐसे संबंधों को दर्शाते हैं, जिनमें अनुरूपता निहित है—ऐसी परिस्थिति जिसमें एक वस्तु किसी दूसरी के समान है या कुछ क्षेत्रों में उसके जैसी ही है।",
