    "name" : "उद्देश्य",
    "description" : "इस कार्यक्षेत्र का उपयोग उन शब्दों के लिए करें जो दर्शाते हैं कि कोई काम इस उद्देश्य से किया गया है ताकि कोई और काम हो सके। संबंधित कार्यक्षेत्र: (गतिविधि का) लक्ष्य; उद्देश्य, ध्येय",
