    "name" : "स्वीकार कर लेना",
    "description" : "इस कार्यक्षेत्र का उपयोग उन शब्दों के लिए करें, जो दर्शाते हैं कि वक्ता विवाद के दौरान किसी बात को स्वीकार कर लेता है।",
    "value" : "9.6.2.9 स्वीकार कर लेना"
