    "name" : "सड़कों के नाम",
    "description" : "इस कार्यक्षेत्र का उपयोग राजमार्गों, सड़कों, गलियों या मार्गों के नामों के लिए करें। यदि नाम बहुत सारे हैं, तो केवल महत्वपूर्ण नामों (उदाहरण के लिए किंग्स हाइवे) या अक्सर उपयोग होने वाले नामों (उदाहरणार्थ, महात्मा गाँधी मार्ग) को ही सम्मिलित करें।",
